import React, {useEffect} from 'react';
import './App.scss';
import axios from "axios";
import {useActions} from "./hooks/useActions";

const App: React.FC = () => {
    const {fetchWeater} = useActions()
    useEffect(()=>{
        axios.get('https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/kyiv?unitGroup=metric&key=KXLCQFR4Q8PKE8LW86YXF7QWD&contentType=json').then(res=>fetchWeater(res.data));
    },[]);
    return (
            <div className="App">
                <h1>Works</h1>
            </div>
    );
}

export default App;
